void laf05_init(void)
{

    /*
     * Rows (y): redshift
     * Cols (x): obscuration
     */

    double xa[LAF05_N_NH];
    for (size_t i=0; i<LAF05_N_NH; i++) {
        xa[i] = (i < LAF05_N_NH - 2) ? 20 + i * 0.2 : 24.5 + (i - LAF05_N_NH + 2) * 1.0;
    }

    double ya[LAF05_N_Z];
    for (size_t i=0; i<LAF05_N_Z; i++) {
        ya[i] = 0.001 * (i + 1);
    }

	double za[LAF05_N_Z * LAF05_N_NH];
	for (size_t i=0; i<LAF05_N_Z; i++) {
		for (size_t j=0; j<LAF05_N_NH; j++) {
			za[j + LAF05_N_NH * i] = laf05_corr[i][j];
        }
    }

	laf05.spline = gsl_spline2d_alloc(gsl_interp2d_bicubic, LAF05_N_NH, LAF05_N_Z);
	laf05.xacc = gsl_interp_accel_alloc();
	laf05.yacc = gsl_interp_accel_alloc();
	gsl_spline2d_init(laf05.spline, xa, ya, za, LAF05_N_NH, LAF05_N_Z);

}

void laf05_free(void)
{
    gsl_spline2d_free(laf05.spline);
    gsl_interp_accel_free(laf05.xacc);
    gsl_interp_accel_free(laf05.yacc);
}

double laf05_get_corr(double log_N_H, double z)
{
	return gsl_spline2d_eval_extrap(laf05.spline, log_N_H, z, laf05.xacc, laf05.yacc);
}
